DROP TABLE IF EXISTS `comments`;
CREATE TABLE `comments` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `post_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '帖子的id',
  `uid` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '评论者的id',
  `p_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT 'at评论的id',
  `p_uid` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '被回复的人的id',
  `content` varchar(500) NOT NULL DEFAULT '' COMMENT '评论内容',
  `is_read` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否已读',
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '评论创建时间',
  `read_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '读取评论的时间',
  `_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'dba',
  PRIMARY KEY (`id`),
  KEY `ix_postid` (`post_id`),
  KEY `ix_uid` (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8 COMMENT='评论表';

