  `mid` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '第三方系统的用户唯一id',
  `head_img` varchar(20) NOT NULL DEFAULT '' COMMENT '头像地址',
  `nick_name` char(11) NOT NULL DEFAULT '' COMMENT '用户昵称',
