  `login_type` varchar(5) NOT NULL DEFAULT 'elong' COMMENT '登录方式,elong/qq/weixin',
  `visible_item` smallint(3) NOT NULL DEFAULT '7' COMMENT '二进制转10进制存储有哪些可见联系方式',
  `group_visible` tinyint(2) NOT NULL DEFAULT '1' COMMENT '对同行小组是否可见',
  `sign` varchar(40) NOT NULL DEFAULT '' COMMENT '个人签名',
  `dest_wanted` varchar(60) NOT NULL DEFAULT '' COMMENT '想去的地方',
  `dest_gone` varchar(60) NOT NULL DEFAULT '' COMMENT '已经去过的地方',
  `residence` varchar(60) NOT NULL DEFAULT '' COMMENT '常驻地',
