  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '用户信息更新时间',
  `_timestamp` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '需要增加的列，用于DMO抽取数据',
  PRIMARY KEY (`id`),
